        style={{
          background: "no-repeat url(glassesImage/model.jpg)",
          height: "300px",
          backgroundSize: "contain",
          backgroundPosition: "center",
          position: "relative",
        }}
      >
        <img
          style={{
            position: "absolute",
            top: "23%",
            left: "44%",
            width: "155px",
            height: "41px",
            // opacity: 0,
          }}
        ></img>
      </div>
    );
  }
}
